import React from "react";
import { Route, Routes, Navigate } from "react-router-dom";
import Signup from "./components/Signup"; // Ensure paths are correct
import Login from "./components/Login";
import Diabetic from "./components/DiabeticModel";
import Home from "./components/Home/Home"; // Adjust based on your folder structure
import Admin from "./components/Admin";
import GetUsers from "./components/GetAllUsers";
import UAccount from "./components/UserAcc";
import ServicePage from "./components/Service";
import AboutUs from "./components/AboutUs";
import AllDiabeticHistory from "./components/allUserDiabeticHis";
import DiabeticHistory from "./components/UserDiabeticHistory";
import HeartDiseasePrediction from "./components/HeartModel";
import PredictionHistory from "./components/UserDiabeticHistory";
import HeartDiseaseHistory from "./components/AllUserHeartHis";
import UserHeartDiseaseHistory from "./components/UserHeartHistory";

function App() {
  // Check if a user token exists in local storage
  const user = localStorage.getItem("token");

  return (
    <Routes>
      {/* Conditional rendering based on user authentication */}
      {user ? (
        <>
          {/* Protected Routes */}
          <Route path="/admin" element={<Admin />} />
          <Route path="/getUsers" element={<GetUsers />} />
          <Route path="/userAcc" element={<UAccount />} />
          <Route path="/diabeticHis" element={<AllDiabeticHistory />} />
          <Route path="/userDiabeticHis" element={<DiabeticHistory />} />
          <Route path="/heartPrediction" element={<HeartDiseasePrediction />} />
          <Route path="/userDiaHis" element={<PredictionHistory />} />
          <Route path="/Heart-his" element={<HeartDiseaseHistory />} />
          <Route path="/User-Heart-his" element={<UserHeartDiseaseHistory />} />
          {/* Redirect to Home if no path matches */}
          <Route path="*" element={<Navigate to="/home" replace />} />
        </>
      ) : (
        <>
          {/* Public Routes */}
          <Route path="/signup" element={<Signup />} />
          <Route path="/login" element={<Login />} />
          <Route path="/home" element={<Home />} />
          <Route path="/Diabetic" element={<Diabetic />} />
          <Route path="/service" element={<ServicePage />} />
          <Route path="/aboutUs" element={<AboutUs />} />
          {/* Redirect to Login if no path matches */}
          <Route path="*" element={<Navigate to="/login" replace />} />
        </>
      )}
    </Routes>
  );
}

export default App;
